    //24
    'When <img src="//latex.artofproblemsolving.com/c/d/c/cdc6862b40b3f60c41f6d329f6d8ff4eea5c8b93.png" class="latex" alt="$1999^{2000}$" style="vertical-align: 0px" width="61" height="15"> is divided by <img src="//latex.artofproblemsolving.com/7/9/0/79069377f91364c2f87a64e5f9f562a091c8a6c1.png" class="latex" alt="$5$" width="8" height="12">, the remainder is  <img src="//latex.artofproblemsolving.com/b/a/4/ba4822a38fc52b22a7f0880bbc9eb46cb9dd9760.png" class="latex" alt="$\text{(A)} 0 qquad \text{(B)} 1 qquad \text{(C)} 2 qquad \text{(D)} 3 qquad \text{(E)} 4$" style="vertical-align: -4px" width="330" height="17"> <br>',
    //25
