    //23
    'Points <img src="//latex.artofproblemsolving.com/e/f/f/eff43e84f8a3bcf7b6965f0a3248bc4d3a9d0cd4.png" class="latex" alt="$R$" width="14" height="12">, <img src="//latex.artofproblemsolving.com/a/d/2/ad28c83c99a8fd0dd2e2e594c9d02ee532765a0a.png" class="latex" alt="$S$" width="12" height="12"> and <img src="//latex.artofproblemsolving.com/2/5/5/2554b6496c3b678897e9b060ef00aa9f0a7d7ece.png" class="latex" alt="$T$" width="13" height="12"> are vertices of an equilateral triangle, and points <img src="//latex.artofproblemsolving.com/6/a/4/6a47ca0fe7cb276abc022af6ac88ddae1a9d6894.png" class="latex" alt="$X$" width="15" height="12">, <img src="//latex.artofproblemsolving.com/c/e/5/ce58e4af225c93d08606c26554caaa5ae32edeba.png" class="latex" alt="$Y$" width="14" height="12"> and <img src="//latex.artofproblemsolving.com/3/e/a/3ead47fb9fb4a4c273feee398f72ff2a09702b84.png" class="latex" alt="$Z$" width="13" height="12"> are midpoints of its sides. How many noncongruent triangles can be drawn using any three of these six points as vertices? <img src="//latex.artofproblemsolving.com/8/5/a/85a81732e12f5eaa1d40ce7d0ba5d9185110000f.png" class="latexcenter" alt="[asy] pair SS,R,T,X,Y,Z; SS = (2,2*sqrt(3)); R = (0,0); T = (4,0); X = (2,0); Y = (1,sqrt(3)); Z = (3,sqrt(3)); dot(SS); dot(R); dot(T); dot(X); dot(Y); dot(Z); label(&quot;$S$&quot;,SS,N); label(&quot;$R$&quot;,R,SW); label(&quot;$T$&quot;,T,SE); label(&quot;$X$&quot;,X,S); label(&quot;$Y$&quot;,Y,NW); label(&quot;$Z$&quot;,Z,NE); [/asy]" width="252" height="225"> <img src="//latex.artofproblemsolving.com/c/2/4/c245e53f2cab3128341330594bae2c64d0c9bead.png" class="latex" alt="$\text{(A)} 1 qquad \text{(B)} 2 qquad \text{(C)} 3 qquad \text{(D)} 4 qquad \text{(E)} 20$" style="vertical-align: -4px" width="339" height="17">',
    //24
