    'In a mathematics contest with ten problems, a student gains 5 points for a correct answer and loses 2 points for an incorrect answer. If Olivia answered every problem and her score was 29, how many correct answers did she have? <img src="//latex.artofproblemsolving.com/2/3/e/23ea832b5d9e12d56157af2a7ce4a212d752fae0.png" class="latex" alt="$\text{(A)} 5qquad\text{(B)} 6qquad\text{(C)} 7qquad\text{(D)} 8qquad\text{(E)} 9$" style="vertical-align: -4px" width="330" height="17">',
