    //6
    'Given the areas of the three squares in the figure, what is the area of the interior triangle? <img src="//latex.artofproblemsolving.com/3/7/2/372ee1f13836b7ad774c0aa23e598d4f8b07cbb6.png" class="latexcenter" alt="[asy] draw((0,0)--(-5,12)--(7,17)--(12,5)--(17,5)--(17,0)--(12,0)--(12,-12)--(0,-12)--(0,0)--(12,5)--(12,0)--cycle,linewidth(1)); label(&quot;$25$&quot;,(14.5,1),N); label(&quot;$144$&quot;,(6,-7.5),N); label(&quot;$169$&quot;,(3.5,7),N); [/asy]" width="192" height="252"> <img src="//latex.artofproblemsolving.com/0/7/d/07d4a247da685400225d1617e4e1141e5942e408.png" class="latex" alt="$mathrm{(A)} 13 qquadmathrm{(B)} 30 qquadmathrm{(C)} 60 qquadmathrm{(D)} 300 qquadmathrm{(E)} 1800$" style="vertical-align: -4px" width="414" height="18">',
    //7
    'Blake and Jenny each took four <img src="//latex.artofproblemsolving.com/e/5/9/e59e2c6e83eb78cca610a5fd4070ae01c8d4ae60.png" class="latex" alt="$100$" style="vertical-align: 0px" width="26" height="13">-point tests. Blake averaged <img src="//latex.artofproblemsolving.com/7/6/d/76d15d808807bfa561e72dc8111649ed0a204ebe.png" class="latex" alt="$78$" width="17" height="12"> on the four tests. Jenny scored <img src="//latex.artofproblemsolving.com/f/c/6/fc606f7f1e530731ab4f1cc364c01dc64a4455ee.png" class="latex" alt="$10$" style="vertical-align: 0px" width="17" height="13"> points higher than Blake on the first test, <img src="//latex.artofproblemsolving.com/f/c/6/fc606f7f1e530731ab4f1cc364c01dc64a4455ee.png" class="latex" alt="$10$" style="vertical-align: 0px" width="17" height="13"> points lower than him on the second test, and <img src="//latex.artofproblemsolving.com/f/8/3/f8366cd6196dd8a9da6d38a3e9eafb109e99d53e.png" class="latex" alt="$20$" width="17" height="12"> points higher on both the third and fourth tests. What is the difference between Jenny\'s average and Blake\'s average on these four tests? <img src="//latex.artofproblemsolving.com/7/0/5/7056eb63ac3d7a8d9f08bcf722f5c26b2a1e99bc.png" class="latex" alt="$mathrm{(A)}  10  qquadmathrm{(B)} 15 qquadmathrm{(C)} 20 qquadmathrm{(D)} 25 qquadmathrm{(E)} 40$" style="vertical-align: -4px" width="387" height="18">',
    //8
    '<img src="//latex.artofproblemsolving.com/d/b/4/db4f6c3c2dae4895eaa4276c773fa77278b5bc21.png" class="latex" alt="$\textbf{Bake Sale}$" width="81" height="11"> Four friends, Art, Roger, Paul and Trisha, bake cookies, and all cookies have the same thickness. The shapes of the cookies differ, as shown. <img src="//latex.artofproblemsolving.com/7/f/3/7f3b4ea3b8abe9ced6095c7d75f207a1127ee843.png" class="latex" alt="$circ$" style="vertical-align: 1px" width="8" height="7"> Art\'s cookies are trapezoids.  <img src="//latex.artofproblemsolving.com/3/d/5/3d531b95a6e97cf02b7ade98fe9eebdcf1a10ad3.png" class="latexcenter" alt="[asy] size(80);defaultpen(linewidth(0.8));defaultpen(fontsize(8)); draw(origin--(5,0)--(5,3)--(2,3)--cycle); draw(rightanglemark((5,3), (5,0), origin)); label(&quot;5 in&quot;, (2.5,0), S); label(&quot;3 in&quot;, (5,1.5), E); label(&quot;3 in&quot;, (3.5,3), N); [/asy]" width="135" height="92"> <img src="//latex.artofproblemsolving.com/7/f/3/7f3b4ea3b8abe9ced6095c7d75f207a1127ee843.png" class="latex" alt="$circ$" style="vertical-align: 1px" width="8" height="7"> Roger\'s cookies are rectangles. <img src="//latex.artofproblemsolving.com/3/b/b/3bb42c95ed47ad88dc8045d2158c24b3b513dc36.png" class="latexcenter" alt="[asy] size(80);defaultpen(linewidth(0.8));defaultpen(fontsize(8)); draw(origin--(4,0)--(4,2)--(0,2)--cycle); draw(rightanglemark((4,2), (4,0), origin)); draw(rightanglemark((0,2), origin, (4,0))); label(&quot;4 in&quot;, (2,0), S); label(&quot;2 in&quot;, (4,1), E); [/asy]" width="135" height="68"> <img src="//latex.artofproblemsolving.com/7/f/3/7f3b4ea3b8abe9ced6095c7d75f207a1127ee843.png" class="latex" alt="$circ$" style="vertical-align: 1px" width="8" height="7"> Paul\'s cookies are parallelograms. <img src="//latex.artofproblemsolving.com/0/f/f/0ff4ffd66b62485d742d63d1b12a9a321024937a.png" class="latexcenter" alt="[asy] size(80);defaultpen(linewidth(0.8));defaultpen(fontsize(8)); draw(origin--(3,0)--(2.5,2)--(-0.5,2)--cycle); draw((2.5,2)--(2.5,0), dashed); draw(rightanglemark((2.5,2),(2.5,0), origin)); label(&quot;3 in&quot;, (1.5,0), S); label(&quot;2 in&quot;, (2.5,1), W); [/asy]" width="135" height="92"> <img src="//latex.artofproblemsolving.com/7/f/3/7f3b4ea3b8abe9ced6095c7d75f207a1127ee843.png" class="latex" alt="$circ$" style="vertical-align: 1px" width="8" height="7"> Trisha\'s cookies are triangles. <img src="//latex.artofproblemsolving.com/5/b/7/5b7f1b1605342590d1d41eae41b1be7f1ebbf9a5.png" class="latexcenter" alt="[asy] size(80);defaultpen(linewidth(0.8));defaultpen(fontsize(8)); draw(origin--(3,0)--(3,4)--cycle); draw(rightanglemark((3,4),(3,0), origin)); label(&quot;3 in&quot;, (1.5,0), S); label(&quot;4 in&quot;, (3,2), E); [/asy]" width="122" height="135"> Each friend uses the same amount of dough, and Art makes exactly 12 cookies. Who gets the fewest cookies from one batch of cookie dough? <img src="//latex.artofproblemsolving.com/3/e/3/3e3881ba6aefd6460a29222c57d85978039e7b66.png" class="latex" alt="$\textbf{(A)} \text{Art}qquad\textbf{(B)} \text{Roger}qquad\textbf{(C)} \text{Paul}qquad\textbf{(D)} \text{Trisha}qquad\textbf{(E)} \text{There is a tie for fewest.}$" style="vertical-align: -4px" width="626" height="17">',
