    'Fourteen white cubes are put together to form the figure on the right. The complete surface of the figure, including the bottom, is painted red. The figure is then separated into individual cubes. How many of the individual cubes have exactly four red faces? <img src="//latex.artofproblemsolving.com/a/d/8/ad8d99504ec6b48d8afd6b366c02c827e11c198e.png" class="latexcenter" alt="[asy] import three; defaultpen(linewidth(0.8)); real r=0.5; currentprojection=orthographic(3/4,8/15,7/15); draw(unitcube, white, thick(), nolight); draw(shift(1,0,0)*unitcube, white, thick(), nolight); draw(shift(2,0,0)*unitcube, white, thick(), nolight); draw(shift(0,0,1)*unitcube, white, thick(), nolight); draw(shift(2,0,1)*unitcube, white, thick(), nolight); draw(shift(0,1,0)*unitcube, white, thick(), nolight); draw(shift(2,1,0)*unitcube, white, thick(), nolight); draw(shift(0,2,0)*unitcube, white, thick(), nolight); draw(shift(2,2,0)*unitcube, white, thick(), nolight); draw(shift(0,3,0)*unitcube, white, thick(), nolight); draw(shift(0,3,1)*unitcube, white, thick(), nolight); draw(shift(1,3,0)*unitcube, white, thick(), nolight); draw(shift(2,3,0)*unitcube, white, thick(), nolight); draw(shift(2,3,1)*unitcube, white, thick(), nolight); [/asy]" width="252" height="198"> <img src="//latex.artofproblemsolving.com/b/3/b/b3b8c1194370c54aeaf830aa07ec24c1e91d4acd.png" class="latex" alt="$\textbf{(A)} 4qquad\textbf{(B)} 6qquad\textbf{(C)} 8qquad\textbf{(D)} 10qquad\textbf{(E)} 12$" style="vertical-align: -4px" width="366" height="17">',
