    'In the pattern below, the cat (denoted as a cat in the figures below) moves clockwise through the four squares,  and the mouse (denoted as a mouse in the figures below) moves counterclockwise through the eight exterior segments of the four squares.  <a href="/wiki/index.php/File:2003amc8prob23a.png" class="image"><img alt="2003amc8prob23a.png" src="https://wiki-images.artofproblemsolving.com//thumb/1/1a/2003amc8prob23a.png/800px-2003amc8prob23a.png" width="800" height="177" srcset="https://wiki-images.artofproblemsolving.com//thumb/1/1a/2003amc8prob23a.png/1200px-2003amc8prob23a.png 1.5x, https://wiki-images.artofproblemsolving.com//1/1a/2003amc8prob23a.png 2x"></a>  If the pattern is continued, where would the cat and mouse be after the 247th move?  <a href="/wiki/index.php/File:2003amc8prob23b.png" class="image"><img alt="2003amc8prob23b.png" src="https://wiki-images.artofproblemsolving.com//thumb/e/ed/2003amc8prob23b.png/800px-2003amc8prob23b.png" width="800" height="175" srcset="https://wiki-images.artofproblemsolving.com//thumb/e/ed/2003amc8prob23b.png/1200px-2003amc8prob23b.png 1.5x, https://wiki-images.artofproblemsolving.com//e/ed/2003amc8prob23b.png 2x"></a> ',
    //24
    'A ship travels from point <img src="//latex.artofproblemsolving.com/0/1/9/019e9892786e493964e145e7c5cf7b700314e53b.png" class="latex" alt="$A$" width="13" height="13"> to point <img src="//latex.artofproblemsolving.com/f/f/5/ff5fb3d775862e2123b007eb4373ff6cc1a34d4e.png" class="latex" alt="$B$" width="14" height="12"> along a semicircular path, centered at Island <img src="//latex.artofproblemsolving.com/6/a/4/6a47ca0fe7cb276abc022af6ac88ddae1a9d6894.png" class="latex" alt="$X$" width="15" height="12">. Then it travels along a straight path from <img src="//latex.artofproblemsolving.com/f/f/5/ff5fb3d775862e2123b007eb4373ff6cc1a34d4e.png" class="latex" alt="$B$" width="14" height="12"> to <img src="//latex.artofproblemsolving.com/c/3/3/c3355896da590fc491a10150a50416687626d7cc.png" class="latex" alt="$C$" width="14" height="12">. Which of these graphs best shows the ship\'s distance from Island <img src="//latex.artofproblemsolving.com/6/a/4/6a47ca0fe7cb276abc022af6ac88ddae1a9d6894.png" class="latex" alt="$X$" width="15" height="12"> as it moves along its course? <img src="//latex.artofproblemsolving.com/9/1/9/91933f8be27c24174af480d964c31782da9f3bb4.png" class="latexcenter" alt="[asy]size(150); pair X=origin, A=(-5,0), B=(5,0), C=(0,5); draw(Arc(X, 5, 180, 360)^^B--C); dot(X); label(&quot;$X$&quot;, X, NE); label(&quot;$C$&quot;, C, N); label(&quot;$B$&quot;, B, E); label(&quot;$A$&quot;, A, W); [/asy]" width="252" height="228">  <a href="/wiki/index.php/File:2003amc8prob24ans.png" class="image"><img alt="2003amc8prob24ans.png" src="https://wiki-images.artofproblemsolving.com//d/d9/2003amc8prob24ans.png" width="800" height="205"></a> ',
    //25
    'In the figure, the area of square <img src="//latex.artofproblemsolving.com/2/b/0/2b076f2e7f124fc5d8b5ef7b30b95bfcfe85449f.png" class="latex" alt="$WXYZ$" width="64" height="12"> is <img src="//latex.artofproblemsolving.com/8/c/4/8c401da100e4ee9c4132a90cf9f6a74e90efbab2.png" class="latex" alt="$25 \text{ cm}^2$" width="51" height="15">. The four smaller squares have sides 1 cm long, either parallel to or coinciding with the sides of the large square. In <img src="//latex.artofproblemsolving.com/8/c/3/8c3a2d2224f7d163b46d702132425d47828bf538.png" class="latex" alt="$\triangle ABC$" width="58" height="13">, <img src="//latex.artofproblemsolving.com/f/3/a/f3ac37c9fa391eebb9601bfaca8bfbfaabdf5ca1.png" class="latex" alt="$AB = AC$" width="80" height="13">, and when <img src="//latex.artofproblemsolving.com/8/c/3/8c3a2d2224f7d163b46d702132425d47828bf538.png" class="latex" alt="$\triangle ABC$" width="58" height="13"> is folded over side <img src="//latex.artofproblemsolving.com/e/3/3/e33fe7d65facd8868f58b6e94ddc7f153a5a3f9f.png" class="latex" alt="$overline{BC}$" width="29" height="15">, point <img src="//latex.artofproblemsolving.com/0/1/9/019e9892786e493964e145e7c5cf7b700314e53b.png" class="latex" alt="$A$" width="13" height="13"> coincides with <img src="//latex.artofproblemsolving.com/5/1/d/51da37d984564162c87710ca27bea422f657fb73.png" class="latex" alt="$O$" width="13" height="12">, the center of square <img src="//latex.artofproblemsolving.com/2/b/0/2b076f2e7f124fc5d8b5ef7b30b95bfcfe85449f.png" class="latex" alt="$WXYZ$" width="64" height="12">. What is the area of <img src="//latex.artofproblemsolving.com/8/c/3/8c3a2d2224f7d163b46d702132425d47828bf538.png" class="latex" alt="$\triangle ABC$" width="58" height="13">, in square centimeters? <img src="//latex.artofproblemsolving.com/f/b/5/fb5de36e57bfb81488edf36e2717cf7b93f0444b.png" class="latexcenter" alt="[asy] defaultpen(fontsize(8)); size(225); pair Z=origin, W=(0,10), X=(10,10), Y=(10,0), O=(5,5), B=(-4,8), C=(-4,2), A=(-13,5); draw((-4,0)--Y--X--(-4,10)--cycle); draw((0,-2)--(0,12)--(-2,12)--(-2,8)--B--A--C--(-2,2)--(-2,-2)--cycle); dot(O); label(&quot;$A$&quot;, A, NW); label(&quot;$O$&quot;, O, NE); label(&quot;$B$&quot;, B, SW); label(&quot;$C$&quot;, C, NW); label(&quot;$W$&quot;,W , NE); label(&quot;$X$&quot;, X, N); label(&quot;$Y$&quot;, Y, S); label(&quot;$Z$&quot;, Z, SE); [/asy]" width="377" height="215"> <img src="//latex.artofproblemsolving.com/f/4/0/f4060296f6cfc830dd8eff64c7db0c55e89d49ca.png" class="latex" alt="$\textbf{(A)} \frac{15}4qquad\textbf{(B)} \frac{21}4qquad\textbf{(C)} \frac{27}4qquad\textbf{(D)} \frac{21}2qquad\textbf{(E)} \frac{27}2$" style="vertical-align: -13px" width="413" height="38">',
