    //9
    'The average of the five numbers in a list is <img src="//latex.artofproblemsolving.com/b/1/c/b1cb5bdce2d06d2419066a2b55ab01d824217bd2.png" class="latex" alt="$54$" style="vertical-align: 0px" width="18" height="13">. The average of the first two numbers is <img src="//latex.artofproblemsolving.com/5/a/f/5afbad0b221f0ef70186fe70b08e6fc1efdd8dfa.png" class="latex" alt="$48$" style="vertical-align: 0px" width="17" height="13">. What is the average of the last three numbers? <img src="//latex.artofproblemsolving.com/b/0/5/b05e935c185f4ace8e5768163f0fc7bb8fcd104c.png" class="latex" alt="$\textbf{(A)} 55 qquad \textbf{(B)} 56 qquad \textbf{(C)} 57 qquad \textbf{(D)} 58 qquad \textbf{(E)} 59$" style="vertical-align: -4px" width="394" height="17">',
    //10
    'Handy Aaron helped a neighbor <img src="//latex.artofproblemsolving.com/b/c/d/bcdf445651d486149cfa3bbc5b8784f772cb91f5.png" class="latex" alt="$1 \frac14$" style="vertical-align: -13px" width="20" height="37"> hours on Monday, <img src="//latex.artofproblemsolving.com/9/0/6/906734e2f1010e9a171ffee8050cbc0649cea37c.png" class="latex" alt="$50$" width="17" height="12"> minutes on Tuesday, from 8:20 to 10:45 on Wednesday morning, and a half-hour on Friday. He is paid <img src="//latex.artofproblemsolving.com/3/1/6/31694dffa8d324144c77132698907df5400f1655.png" class="latex" alt="$\textdollar 3$" style="vertical-align: -1px" width="17" height="14"> per hour. How much did he earn for the week? <img src="//latex.artofproblemsolving.com/0/2/f/02facc62dba68191a1493a3ae544d3aa68132cc4.png" class="latex" alt="$\textbf{(A)} \textdollar 8 qquad \textbf{(B)} \textdollar 9 qquad \textbf{(C)} \textdollar 10 qquad \textbf{(D)} \textdollar 12 qquad \textbf{(E)} \textdollar 15$" style="vertical-align: -4px" width="421" height="17">',
    //11
    'The numbers <img src="//latex.artofproblemsolving.com/1/6/9/1697819f92b5937788c126eb111a99f6102cbe08.png" class="latex" alt="$-2, 4, 6, 9$" style="vertical-align: -3px" width="74" height="16"> and <img src="//latex.artofproblemsolving.com/e/d/f/edf074831eb5bc9e61d6d6e09f525a86e3068f6a.png" class="latex" alt="$12$" style="vertical-align: 0px" width="17" height="12"> are rearranged according to these rules:         1. The largest isnt first, but it is in one of the first three places.          2. The smallest isnt last, but it is in one of the last three places.          3. The median isnt first or last. What is the average of the first and last numbers? <img src="//latex.artofproblemsolving.com/0/a/2/0a23fc06b89b7cc5977ec414d39f5b3d40209c49.png" class="latex" alt="$\textbf{(A)} 3.5 qquad \textbf{(B)} 5 qquad \textbf{(C)} 6.5 qquad \textbf{(D)} 7.5 qquad \textbf{(E)} 8$" style="vertical-align: -4px" width="391" height="17">',
    //12
    'Niki usually leaves her cell phone on. If her cell phone is on but she is not actually using it, the battery will last for <img src="//latex.artofproblemsolving.com/e/2/9/e290f2cba0ba0e11c0b91630da15a408da2fcf1c.png" class="latex" alt="$24$" style="vertical-align: 0px" width="18" height="12"> hours. If she is using it constantly, the battery will last for only <img src="//latex.artofproblemsolving.com/7/c/d/7cde695f2e4542fd01f860a89189f47a27143b66.png" class="latex" alt="$3$" width="8" height="12"> hours. Since the last recharge, her phone has been on <img src="//latex.artofproblemsolving.com/b/f/2/bf2c9074b396e3af0dea52d792660eea1c77f10f.png" class="latex" alt="$9$" width="8" height="12"> hours, and during that time she has used it for <img src="//latex.artofproblemsolving.com/3/0/2/302e99c1c7cd91a6ae371139e5142ccef5977dca.png" class="latex" alt="$60$" width="17" height="12"> minutes. If she doesnt use it any more but leaves the phone on, how many more hours will the battery last? <img src="//latex.artofproblemsolving.com/6/f/9/6f9fc9ab591f2afc03296c201931666d57db5981.png" class="latex" alt="$\textbf{(A)} 7 qquad \textbf{(B)} 8 qquad \textbf{(C)} 11 qquad \textbf{(D)} 14 qquad \textbf{(E)} 15$" style="vertical-align: -4px" width="376" height="17">',
    //13
