    //18
    'A decorative window is made up of a rectangle with semicircles at either end. The ratio of <img src="//latex.artofproblemsolving.com/b/c/5/bc56862b1fdb71204894da278e42ef75de73a40b.png" class="latex" alt="$AD$" width="28" height="13"> to <img src="//latex.artofproblemsolving.com/5/7/e/57ee5125358c0606c9b588580ddfa66f83e607b7.png" class="latex" alt="$AB$" width="27" height="13"> is <img src="//latex.artofproblemsolving.com/8/0/e/80e47d95347d6e72d1b3e8a4aea3dd20082f3cc3.png" class="latex" alt="$3:2$" width="32" height="12">. And <img src="//latex.artofproblemsolving.com/5/7/e/57ee5125358c0606c9b588580ddfa66f83e607b7.png" class="latex" alt="$AB$" width="27" height="13"> is 30 inches. What is the ratio of the area of the rectangle to the combined area of the semicircles? <img src="//latex.artofproblemsolving.com/1/b/d/1bd7bb101d1f617dcc2d568edfde1a17ef3345b4.png" class="latexcenter" alt="[asy] import graph; size(5cm); real lsf=0; pen dps=linewidth(0.7)+fontsize(8); defaultpen(dps); pen ds=black; real xmin=-4.27,xmax=14.73,ymin=-3.22,ymax=6.8; draw((0,4)--(0,0)); draw((0,0)--(2.5,0)); draw((2.5,0)--(2.5,4)); draw((2.5,4)--(0,4)); draw(shift((1.25,4))*xscale(1.25)*yscale(1.25)*arc((0,0),1,0,180)); draw(shift((1.25,0))*xscale(1.25)*yscale(1.25)*arc((0,0),1,-180,0)); dot((0,0),ds); label(&quot;$A$&quot;,(-0.26,-0.23),NE*lsf); dot((2.5,0),ds); label(&quot;$B$&quot;,(2.61,-0.26),NE*lsf); dot((0,4),ds); label(&quot;$D$&quot;,(-0.26,4.02),NE*lsf); dot((2.5,4),ds); label(&quot;$C$&quot;,(2.64,3.98),NE*lsf); clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);[/asy]" width="122" height="238"> <img src="//latex.artofproblemsolving.com/2/1/3/213406dc81dec3a25a386674787cbe3237ed6f68.png" class="latex" alt="$\textbf{(A)} 2:3qquad\textbf{(B)} 3:2qquad\textbf{(C)} 6:piqquad\textbf{(D)} 9:piqquad\textbf{(E)} 30&nbsp;:pi$" style="vertical-align: -4px" width="485" height="17">',
    //19
    'The two circles pictured have the same center <img src="//latex.artofproblemsolving.com/c/3/3/c3355896da590fc491a10150a50416687626d7cc.png" class="latex" alt="$C$" width="14" height="12">. Chord <img src="//latex.artofproblemsolving.com/c/f/b/cfbb4c52e011ceed6e813118a7d59e931af444a2.png" class="latex" alt="$overline{AD}$" width="29" height="15"> is tangent to the inner circle at <img src="//latex.artofproblemsolving.com/f/f/5/ff5fb3d775862e2123b007eb4373ff6cc1a34d4e.png" class="latex" alt="$B$" width="14" height="12">, <img src="//latex.artofproblemsolving.com/a/1/7/a179ff2638e4799cadd820db205c2beff6299ce9.png" class="latex" alt="$AC$" width="27" height="13"> is <img src="//latex.artofproblemsolving.com/f/c/6/fc606f7f1e530731ab4f1cc364c01dc64a4455ee.png" class="latex" alt="$10$" style="vertical-align: 0px" width="17" height="13">, and chord <img src="//latex.artofproblemsolving.com/c/f/b/cfbb4c52e011ceed6e813118a7d59e931af444a2.png" class="latex" alt="$overline{AD}$" width="29" height="15"> has length <img src="//latex.artofproblemsolving.com/9/a/5/9a5b4928c8fe50ce3c2428da3bee3505e891b788.png" class="latex" alt="$16$" style="vertical-align: 0px" width="17" height="13">. What is the area between the two circles? <img src="//latex.artofproblemsolving.com/b/0/e/b0e37b89810e0f46b0b25f1ee6ae9bb081a2a5d8.png" class="latexcenter" alt="[asy] unitsize(45); import graph; size(300); real lsf = 0.5; pen dp = linewidth(0.7) + fontsize(10); defaultpen(dp); pen ds = black; pen xdxdff = rgb(0.49,0.49,1); draw((2,0.15)--(1.85,0.15)--(1.85,0)--(2,0)--cycle); draw(circle((2,1),2.24)); draw(circle((2,1),1)); draw((0,0)--(4,0)); draw((0,0)--(2,1)); draw((2,1)--(2,0));  dot((0,0),ds); label(&quot;$A$&quot;, (-0.19,-0.23),NE*lsf); dot((2,0),ds); label(&quot;$B$&quot;, (1.97,-0.31),NE*lsf); dot((2,1),ds); label(&quot;$C$&quot;, (1.96,1.09),NE*lsf); dot((4,0),ds); label(&quot;$D$&quot;, (4.07,-0.24),NE*lsf); clip((-3.1,-7.72)--(-3.1,4.77)--(11.74,4.77)--(11.74,-7.72)--cycle); [/asy]" width="345" height="338"> <img src="//latex.artofproblemsolving.com/3/4/c/34c9b53624466c0ccdeb42ee4daaaa478f49d9cd.png" class="latex" alt="$\textbf{(A)} 36 pi qquad\textbf{(B)} 49 piqquad\textbf{(C)} 64 piqquad\textbf{(D)} 81 piqquad\textbf{(E)} 100 pi$" style="vertical-align: -4px" width="458" height="17">',
    //20
    'In a room, <img src="//latex.artofproblemsolving.com/6/f/5/6f568e6598e1bdb1664691a4dcbb263ad2b0e9d9.png" class="latex" alt="$2/5$" style="vertical-align: -4px" width="26" height="18"> of the people are wearing gloves, and <img src="//latex.artofproblemsolving.com/2/b/c/2bcddca5092a7ec886294a0561a3f69b682f12d0.png" class="latex" alt="$3/4$" style="vertical-align: -4px" width="27" height="18"> of the people are wearing hats. What is the minimum number of people in the room wearing both a hat and a glove?  <img src="//latex.artofproblemsolving.com/7/c/d/7cd2a81c454712ba34cf92897440da60f8f500c7.png" class="latex" alt="$\textbf{(A)} 3 qquad\textbf{(B)} 5qquad\textbf{(C)} 8qquad\textbf{(D)} 15qquad\textbf{(E)} 20$" style="vertical-align: -4px" width="366" height="17">',
    //21
    'Hui is an avid reader. She bought a copy of the best seller <i>Math is Beautiful</i>. On the first day, Hui read <img src="//latex.artofproblemsolving.com/4/3/8/4386436ff16509fe977cc2c9f87c3f170990b8f3.png" class="latex" alt="$1/5$" style="vertical-align: -4px" width="26" height="18"> of the pages plus <img src="//latex.artofproblemsolving.com/e/d/f/edf074831eb5bc9e61d6d6e09f525a86e3068f6a.png" class="latex" alt="$12$" style="vertical-align: 0px" width="17" height="12"> more, and on the second day she read <img src="//latex.artofproblemsolving.com/8/f/8/8f88d403085fe6600059002646348a5f267266d1.png" class="latex" alt="$1/4$" style="vertical-align: -4px" width="27" height="18"> of the remaining pages plus <img src="//latex.artofproblemsolving.com/f/1/9/f1965fae079a9ba2c0726c307070c2355dfcb213.png" class="latex" alt="$15$" style="vertical-align: 0px" width="17" height="13"> pages. On the third day she read <img src="//latex.artofproblemsolving.com/2/1/7/217aedbdc339bacc8ba075a2ec16902b098194e3.png" class="latex" alt="$1/3$" style="vertical-align: -4px" width="26" height="18"> of the remaining pages plus <img src="//latex.artofproblemsolving.com/5/e/7/5e7a1b6098a8c98b8e4adae526aeef4b91712620.png" class="latex" alt="$18$" style="vertical-align: 0px" width="17" height="13"> pages. She then realized that there were only <img src="//latex.artofproblemsolving.com/3/e/6/3e67376d85a21889a01b76d7c9d8c765b2bac379.png" class="latex" alt="$62$" width="17" height="12"> pages left to read, which she read the next day. How many pages are in this book?  <img src="//latex.artofproblemsolving.com/d/6/0/d6052ada2f93c38c8d5377cce3b55d683297cbf6.png" class="latex" alt="$\textbf{(A)} 120 qquad\textbf{(B)} 180qquad\textbf{(C)} 240qquad\textbf{(D)} 300qquad\textbf{(E)} 360$" style="vertical-align: -4px" width="439" height="17">',
    //22
    'The hundreds digit of a three-digit number is <img src="//latex.artofproblemsolving.com/4/1/c/41c544263a265ff15498ee45f7392c5f86c6d151.png" class="latex" alt="$2$" width="8" height="12"> more than the units digit. The digits of the three-digit number are reversed, and the result is subtracted from the original three-digit number. What is the units digit of the result? <img src="//latex.artofproblemsolving.com/a/0/b/a0b4d082b8cb618cd2ee8ec7ad7846af5e4ff6fa.png" class="latex" alt="$\textbf{(A)} 0 qquad\textbf{(B)} 2qquad\textbf{(C)} 4qquad\textbf{(D)} 6qquad\textbf{(E)} 8$" style="vertical-align: -4px" width="348" height="17">',
    //23
