    //15
    'At Euler Middle School, <img src="//latex.artofproblemsolving.com/e/e/2/ee25c9b9adcc4a8f375271a0e11af30133a6fb2f.png" class="latex" alt="$198$" style="vertical-align: 0px" width="26" height="13"> students voted on two issues in a school referendum with the following results: <img src="//latex.artofproblemsolving.com/9/a/c/9ac7aa4fe47f55808896713ce8fcd30b954e59a3.png" class="latex" alt="$149$" style="vertical-align: 0px" width="26" height="13"> voted in favor of the first issue and <img src="//latex.artofproblemsolving.com/2/f/5/2f5dc392ba2faf31608de0cc131ab8c7227b31dd.png" class="latex" alt="$119$" style="vertical-align: 0px" width="26" height="13"> voted in favor of the second issue. If there were exactly <img src="//latex.artofproblemsolving.com/0/6/5/0657f5cd42256c0a39d45b265235e2a939625515.png" class="latex" alt="$29$" width="17" height="12"> students who voted against both issues, how many students voted in favor of both issues? <img src="//latex.artofproblemsolving.com/b/b/6/bb6632c2489836a4e7bc84e5ef04d42c775be73a.png" class="latex" alt="$\textbf{(A) }49qquad\textbf{(B) }70qquad\textbf{(C) }79qquad\textbf{(D) }99qquad \textbf{(E) }149$" style="vertical-align: -4px" width="407" height="17">',
    //16
    'In a middle-school mentoring program, a number of the sixth graders are paired with a ninth-grade student as a buddy. No ninth grader is assigned more than one sixth-grade buddy. If <img src="//latex.artofproblemsolving.com/4/e/1/4e1965f8d70832ded66434c75a7bd52b75090af0.png" class="latex" alt="$\frac{1}{3}$" style="vertical-align: -12px" width="11" height="37"> of all the ninth graders are paired with <img src="//latex.artofproblemsolving.com/c/a/2/ca2297526ede0e6c616802ca72adf69c82518f25.png" class="latex" alt="$\frac{2}{5}$" style="vertical-align: -12px" width="11" height="37"> of all the sixth graders, what fraction of the total number of sixth and ninth graders have a buddy? <img src="//latex.artofproblemsolving.com/4/f/d/4fda518ae91af02c569bf2b78ed5f4f89110bee0.png" class="latex" alt="$\textbf{(A) } \frac{2}{15} qquad\textbf{(B) } \frac{4}{11} qquad\textbf{(C) } \frac{11}{30} qquad\textbf{(D) } \frac{3}{8} qquad\textbf{(E) } \frac{11}{15}$" style="vertical-align: -13px" width="408" height="38">',
    //17
    'Jeremy\'s father drives him to school in rush hour traffic in 20 minutes. One day there is no traffic, so his father can drive him 18 miles per hour faster and gets him to school in 12 minutes. How far in miles is it to school? <img src="//latex.artofproblemsolving.com/4/0/a/40a02a26d28004ae85b8e25ae86a061a2de34722.png" class="latex" alt="$\textbf{(A) } 4 qquad \textbf{(B) } 6 qquad \textbf{(C) } 8 qquad \textbf{(D) } 9 qquad \textbf{(E) } 12$" style="vertical-align: -4px" width="362" height="17">',
