    //19
    'A triangle with vertices as <img src="//latex.artofproblemsolving.com/6/8/e/68e8c6017962feb4293fbab0bba51887ba571656.png" class="latex" alt="$A=(1,3)$" style="vertical-align: -4px" width="76" height="18">, <img src="//latex.artofproblemsolving.com/f/7/0/f704a5156f7020d34e532d60908b4ca2a03b521d.png" class="latex" alt="$B=(5,1)$" style="vertical-align: -4px" width="77" height="18">, and <img src="//latex.artofproblemsolving.com/0/4/1/041b48d927275b860db2480c54937ad5229cf91e.png" class="latex" alt="$C=(4,4)$" style="vertical-align: -4px" width="77" height="18"> is plotted on a <img src="//latex.artofproblemsolving.com/d/3/7/d3733016a52c44c32f8ead49f5815f1996947f5d.png" class="latex" alt="$6\times5$" width="40" height="12"> grid. What fraction of the grid is covered by the triangle? <img src="//latex.artofproblemsolving.com/1/d/3/1d3903da82cf00ba34eeffc477bd4a3f65339802.png" class="latex" alt="$\textbf{(A) }\frac{1}{6} qquad \textbf{(B) }\frac{1}{5} qquad \textbf{(C) }\frac{1}{4} qquad \textbf{(D) }\frac{1}{3} qquad \textbf{(E) }\frac{1}{2}$" style="vertical-align: -13px" width="371" height="37"> <img src="//latex.artofproblemsolving.com/e/5/2/e52b5a181480dd60bedad1f91e8e9246b9f0c4fa.png" class="latexcenter" alt="[asy] draw((1,0)--(1,5),linewidth(.5)); draw((2,0)--(2,5),linewidth(.5)); draw((3,0)--(3,5),linewidth(.5)); draw((4,0)--(4,5),linewidth(.5)); draw((5,0)--(5,5),linewidth(.5)); draw((6,0)--(6,5),linewidth(.5)); draw((0,1)--(6,1),linewidth(.5)); draw((0,2)--(6,2),linewidth(.5)); draw((0,3)--(6,3),linewidth(.5)); draw((0,4)--(6,4),linewidth(.5)); draw((0,5)--(6,5),linewidth(.5));  draw((0,0)--(0,6),EndArrow); draw((0,0)--(7,0),EndArrow); draw((1,3)--(4,4)--(5,1)--cycle); label(&quot;$y$&quot;,(0,6),W); label(&quot;$x$&quot;,(7,0),S); label(&quot;$A$&quot;,(1,3),dir(210)); label(&quot;$B$&quot;,(5,1),SE); label(&quot;$C$&quot;,(4,4),dir(100)); [/asy]" width="252" height="218">',
    //20
