    //22
    '/span>On June 1, a group of students is standing in rows, with 15 students in each row. On June 2, the same group is standing with all of the students in one long row. On June 3, the same group is standing with just one student in each row. On June 4, the same group is standing with 6 students in each row. This process continues through June 12 with a different number of students per row each day. However, on June 13, they cannot find a new way of organizing the students. What is the smallest possible number of students in the group? <img src="//latex.artofproblemsolving.com/8/0/4/80467f03ddb1bfdc10656f73dbdd71c3dde242f4.png" class="latex" alt="$\textbf{(A) } 21 qquad \textbf{(B) } 30 qquad \textbf{(C) } 60 qquad \textbf{(D) } 90 qquad \textbf{(E) } 1080$" style="vertical-align: -4px" width="416" height="17">',
    //23
    'Tom has twelve slips of paper which he wants to put into five cups labeled <img src="//latex.artofproblemsolving.com/0/1/9/019e9892786e493964e145e7c5cf7b700314e53b.png" class="latex" alt="$A$" width="13" height="13">, <img src="//latex.artofproblemsolving.com/f/f/5/ff5fb3d775862e2123b007eb4373ff6cc1a34d4e.png" class="latex" alt="$B$" width="14" height="12">, <img src="//latex.artofproblemsolving.com/c/3/3/c3355896da590fc491a10150a50416687626d7cc.png" class="latex" alt="$C$" width="14" height="12">, <img src="//latex.artofproblemsolving.com/9/f/f/9ffb448918db29f2a72f8f87f421b3b3cad18f95.png" class="latex" alt="$D$" width="15" height="12">, <img src="//latex.artofproblemsolving.com/f/a/2/fa2fa899f0afb05d6837885523503a2d4df434f9.png" class="latex" alt="$E$" width="14" height="12">. He wants the sum of the numbers on the slips in each cup to be an integer. Furthermore, he wants the five integers to be consecutive and increasing from <img src="//latex.artofproblemsolving.com/0/1/9/019e9892786e493964e145e7c5cf7b700314e53b.png" class="latex" alt="$A$" width="13" height="13"> to <img src="//latex.artofproblemsolving.com/f/a/2/fa2fa899f0afb05d6837885523503a2d4df434f9.png" class="latex" alt="$E$" width="14" height="12">. The numbers on the papers are <img src="//latex.artofproblemsolving.com/f/3/4/f3407f99083b60a7d8cd5bd4dbfb553cca5bbfd6.png" class="latex" alt="$2, 2, 2, 2.5, 2.5, 3, 3, 3, 3, 3.5, 4,$" style="vertical-align: -3px" width="227" height="16"> and <img src="//latex.artofproblemsolving.com/0/f/b/0fbe18900c777778ad24c84cb3d99df7032b4fd3.png" class="latex" alt="$4.5$" style="vertical-align: 0px" width="22" height="13">. If a slip with <img src="//latex.artofproblemsolving.com/4/1/c/41c544263a265ff15498ee45f7392c5f86c6d151.png" class="latex" alt="$2$" width="8" height="12"> goes into cup <img src="//latex.artofproblemsolving.com/f/a/2/fa2fa899f0afb05d6837885523503a2d4df434f9.png" class="latex" alt="$E$" width="14" height="12"> and a slip with <img src="//latex.artofproblemsolving.com/7/c/d/7cde695f2e4542fd01f860a89189f47a27143b66.png" class="latex" alt="$3$" width="8" height="12"> goes into cup <img src="//latex.artofproblemsolving.com/f/f/5/ff5fb3d775862e2123b007eb4373ff6cc1a34d4e.png" class="latex" alt="$B$" width="14" height="12">, then the slip with <img src="//latex.artofproblemsolving.com/8/7/b/87b8245e043508c7c928c89b42f9ce38f04d720d.png" class="latex" alt="$3.5$" width="22" height="12"> must go into what cup? <img src="//latex.artofproblemsolving.com/0/2/5/025f68af2f90d96e9d98e1f6924121ba40362c33.png" class="latex" alt="$\textbf{(A) } A qquad \textbf{(B) } B qquad \textbf{(C) } C qquad \textbf{(D) } D qquad \textbf{(E) } E$" style="vertical-align: -4px" width="380" height="17">',
    //24
    'A baseball league consists of two four-team divisions. Each team plays every other team in its division <img src="//latex.artofproblemsolving.com/f/c/9/fc97ef67268cd4e91bacdf12b8901d7036c9a056.png" class="latex" alt="$N$" width="16" height="12"> games. Each team plays every team in the other division <img src="//latex.artofproblemsolving.com/5/d/1/5d1e4485dc90c450e8c76826516c1b2ccb8fce16.png" class="latex" alt="$M$" width="19" height="12"> games with <img src="//latex.artofproblemsolving.com/5/3/4/5345bc78b6305a1f3eff93f78a2b79fe6a1383fe.png" class="latex" alt="$N>2M$" style="vertical-align: 0px" width="69" height="13"> and <img src="//latex.artofproblemsolving.com/7/c/7/7c7ed5ca66dffaf99ec55e0b4ed27afc720b7c39.png" class="latex" alt="$M>4$" style="vertical-align: 0px" width="53" height="13">. Each team plays a 76 game schedule. How many games does a team play within its own division? <img src="//latex.artofproblemsolving.com/8/4/a/84a2560f0c21e189238d52a3a7f81fff552b2689.png" class="latex" alt="$\textbf{(A) } 36 qquad \textbf{(B) } 48 qquad \textbf{(C) } 54 qquad \textbf{(D) } 60 qquad \textbf{(E) } 72$" style="vertical-align: -4px" width="398" height="17">',
