    //14
    'Karl\'s car uses a gallon of gas every <img src="//latex.artofproblemsolving.com/8/c/7/8c7f6c79f2148f0cec592c9517b40ee1b82ef22e.png" class="latex" alt="$35$" width="17" height="12"> miles, and his gas tank holds <img src="//latex.artofproblemsolving.com/8/2/0/820a20de2847dfdc1bc5cffc8d904933150032bd.png" class="latex" alt="$14$" style="vertical-align: 0px" width="18" height="12"> gallons when it is full. One day, Karl started with a full tank of gas, drove <img src="//latex.artofproblemsolving.com/9/c/e/9ceffeb3d880c80aa8bb29fe99a7905ca0b2f719.png" class="latex" alt="$350$" width="26" height="12"> miles, bought <img src="//latex.artofproblemsolving.com/8/4/5/8455f3b5cb3b4880b8c9d782a5c1f0334db819eb.png" class="latex" alt="$8$" width="8" height="12"> gallons of gas, and continued driving to his destination. When he arrived, his gas tank was half full. How many miles did Karl drive that day?  <img src="//latex.artofproblemsolving.com/8/1/8/818aeaaa0949200e154becfd823ad68cdce34379.png" class="latex" alt="$\text{(A)}mbox{ }525qquad\text{(B)}mbox{ }560qquad\text{(C)}mbox{ }595qquad\text{(D)}mbox{ }665qquad\text{(E)}mbox{ }735$" style="vertical-align: -4px" width="421" height="17">',
