    'In the cube <img src="//latex.artofproblemsolving.com/0/5/5/055dcba798b1424c44c2606d913e0f2edab1c5ad.png" class="latex" alt="$ABCDEFGH$" width="118" height="13"> with opposite vertices <img src="//latex.artofproblemsolving.com/c/3/3/c3355896da590fc491a10150a50416687626d7cc.png" class="latex" alt="$C$" width="14" height="12"> and <img src="//latex.artofproblemsolving.com/a/0/a/a0a1dbdebe8f3df1befc34f5862f69364b3c11b6.png" class="latex" alt="$E,$" style="vertical-align: -3px" width="18" height="16"> <img src="//latex.artofproblemsolving.com/a/b/b/abb5588023cfa1ac14643e9778699f03eecc57a3.png" class="latex" alt="$J$" width="12" height="12"> and <img src="//latex.artofproblemsolving.com/0/2/7/027f4a11d6090f9eac0ce2488df6384dad1263ea.png" class="latex" alt="$I$" width="9" height="12"> are the midpoints of segments <img src="//latex.artofproblemsolving.com/a/5/6/a56a5efb54b46587c420e1101dc0ef393707a28d.png" class="latex" alt="$overline{FB}$" width="29" height="15"> and <img src="//latex.artofproblemsolving.com/3/6/e/36e9272274bfd904964bafae7af78651bad5b540.png" class="latex" alt="$overline{HD},$" style="vertical-align: -3px" width="36" height="19"> respectively. Let <img src="//latex.artofproblemsolving.com/e/f/f/eff43e84f8a3bcf7b6965f0a3248bc4d3a9d0cd4.png" class="latex" alt="$R$" width="14" height="12"> be the ratio of the area of the cross-section <img src="//latex.artofproblemsolving.com/7/8/e/78ebd359b76a6a2b4da1a3027adc808e24a0277f.png" class="latex" alt="$EJCI$" width="50" height="12"> to the area of one of the faces of the cube. What is <img src="//latex.artofproblemsolving.com/4/1/9/41997da7bd47b28d5c0d22ebb5a00374e566592e.png" class="latex" alt="$R^2?$" width="29" height="15"> <img src="//latex.artofproblemsolving.com/a/1/d/a1d819cf8339fd4ae7e3d612b459da3b1e8cdc7b.png" class="latexcenter" alt="[asy] size(6cm); pair A,B,C,D,EE,F,G,H,I,J; C = (0,0); B = (-1,1); D = (2,0.5); A = B+D; G = (0,2); F = B+G; H = G+D; EE = G+B+D; I = (D+H)/2; J = (B+F)/2; filldraw(C--I--EE--J--cycle,lightgray,black); draw(C--D--H--EE--F--B--cycle);  draw(G--F--G--C--G--H); draw(A--B,dashed); draw(A--EE,dashed); draw(A--D,dashed); dot(A); dot(B); dot(C); dot(D); dot(EE); dot(F); dot(G); dot(H); dot(I); dot(J); label(&quot;$A$&quot;,A,E); label(&quot;$B$&quot;,B,W); label(&quot;$C$&quot;,C,S); label(&quot;$D$&quot;,D,E); label(&quot;$E$&quot;,EE,N); label(&quot;$F$&quot;,F,W); label(&quot;$G$&quot;,G,N); label(&quot;$H$&quot;,H,E); label(&quot;$I$&quot;,I,E); label(&quot;$J$&quot;,J,W); [/asy]" width="258" height="285"> <img src="//latex.artofproblemsolving.com/3/6/a/36ad9b5b5b4e15be1bbefa7c0bfe63f953ec318a.png" class="latex" alt="$\textbf{(A) } \frac{5}{4} qquad \textbf{(B) } \frac{4}{3} qquad \textbf{(C) } \frac{3}{2} qquad \textbf{(D) } \frac{25}{16} qquad \textbf{(E) } \frac{9}{4}$" style="vertical-align: -13px" width="381" height="38">',
    //25
    'How many perfect cubes lie between <img src="//latex.artofproblemsolving.com/4/9/c/49cea34049701bdb4c97030c930e5aa595efae73.png" class="latex" alt="$2^8+1$" style="vertical-align: -1px" width="47" height="16"> and <img src="//latex.artofproblemsolving.com/3/9/9/3994249398f2b6f10f73d45b6db7cc4e6e3aac18.png" class="latex" alt="$2^{18}+1$" style="vertical-align: -1px" width="53" height="16">, inclusive? <img src="//latex.artofproblemsolving.com/9/8/3/98353645442445ce5c70fff9ccbbda0ee47ea338.png" class="latex" alt="$\textbf{(A) }4qquad\textbf{(B) }9qquad\textbf{(C) }10qquad\textbf{(D) }57qquad \textbf{(E) }58$" style="vertical-align: -4px" width="380" height="17">',
