    '/span>A number is called flippy if its digits alternate between two distinct digits. For example, <img src="//latex.artofproblemsolving.com/5/0/9/509a9369d5c55fd98dc99cb2938fb44f0101f90a.png" class="latex" alt="$2020$" width="35" height="12"> and <img src="//latex.artofproblemsolving.com/9/2/7/92749ff1fc2ac6ac551b2e7a0381f9ec4d8427ef.png" class="latex" alt="$37373$" width="44" height="12"> are flippy, but <img src="//latex.artofproblemsolving.com/e/8/f/e8fde3061600d0a096677628ddb37b176c91e386.png" class="latex" alt="$3883$" width="35" height="12"> and <img src="//latex.artofproblemsolving.com/8/6/c/86c5224bc4a0f596b52ae8acd376795ff7c152f5.png" class="latex" alt="$123123$" style="vertical-align: 0px" width="53" height="13"> are not. How many five-digit flippy numbers are divisible by <img src="//latex.artofproblemsolving.com/3/8/9/38905acc065b7a4d105b1a665f63d63db9242638.png" class="latex" alt="$15?$" style="vertical-align: 0px" width="26" height="13"> <img src="//latex.artofproblemsolving.com/c/c/e/cce2de9ae64d0cc1ae9dfce3386ecc0b9b2ba5b0.png" class="latex" alt="$\textbf{(A) }3 qquad \textbf{(B) }4 qquad \textbf{(C) }5 qquad \textbf{(D) }6 qquad \textbf{(E) }8$" style="vertical-align: -4px" width="353" height="17">',
