    'A game board consists of <img src="//latex.artofproblemsolving.com/0/5/e/05e228ac5bee7b9ffb60cacf50f3f2c7c31f8038.png" class="latex" alt="$64$" style="vertical-align: 0px" width="18" height="13"> squares that alternate in color between black and white. The figure below shows square <img src="//latex.artofproblemsolving.com/4/b/4/4b4cade9ca8a2c8311fafcf040bc5b15ca507f52.png" class="latex" alt="$P$" width="14" height="12"> in the bottom row and square <img src="//latex.artofproblemsolving.com/9/8/6/9866e3a998d628ba0941eb4fea0666ac391d149a.png" class="latex" alt="$Q$" style="vertical-align: -3px" width="13" height="16"> in the top row. A marker is placed at <img src="//latex.artofproblemsolving.com/e/3/c/e3ce33ec2a34dc4fddaec3224043f4a72bbe6d0e.png" class="latex" alt="$P.$" width="15" height="12"> A step consists of moving the marker onto one of the adjoining white squares in the row above. How many <img src="//latex.artofproblemsolving.com/e/0/a/e0a0db32027a732ac57d37ef2ae9bb150f65b108.png" class="latex" alt="$7$" width="9" height="12">-step paths are there from <img src="//latex.artofproblemsolving.com/4/b/4/4b4cade9ca8a2c8311fafcf040bc5b15ca507f52.png" class="latex" alt="$P$" width="14" height="12"> to <img src="//latex.artofproblemsolving.com/5/3/5/5351d296b5674cb8207a306f4412527dab730631.png" class="latex" alt="$Q?$" style="vertical-align: -3px" width="22" height="16"> (The figure shows a sample path.) <img src="//latex.artofproblemsolving.com/2/1/0/210b98fc88e4c297773b0400a31787193c0d4338.png" class="latexcenter" alt="[asy]//diagram by SirCalcsALot size(200); int[] x = {6, 5, 4, 5, 6, 5, 6}; int[] y = {1, 2, 3, 4, 5, 6, 7}; int N = 7; for (int i = 0; i < 8; ++i) { for (int j = 0; j < 8; ++j) { draw((i,j)--(i+1,j)--(i+1,j+1)--(i,j+1)--(i,j)); if ((i+j)&nbsp;% 2 == 0) { filldraw((i,j)--(i+1,j)--(i+1,j+1)--(i,j+1)--(i,j)--cycle,black); } } } for (int i = 0; i < N; ++i) { draw(circle((x[i],y[i])+(0.5,0.5),0.35)); } label(&quot;$P$&quot;, (5.5, 0.5)); label(&quot;$Q$&quot;, (6.5, 7.5)); [/asy]" width="335" height="335"> <img src="//latex.artofproblemsolving.com/4/a/f/4afd089177252e283e0176cd12e59980f95df741.png" class="latex" alt="$\textbf{(A) }28 qquad \textbf{(B) }30 qquad \textbf{(C) }32 qquad \textbf{(D) }33 qquad \textbf{(E) }35$" style="vertical-align: -4px" width="398" height="17">',
